(()=>{"use strict";!async function(){try{await async function(t){try{const t=await fetch(`http://api.openweathermap.org/data/2.5/weather?q=San Francisco&units=imperial&appid=446eddd2978f9fcc51700a5b3c599d09`,{mode:"cors"});return await t.json()}catch(t){console.log(t)}}().then((t=>{return function(t){const e=document.querySelector(".location"),n=document.querySelector(".temperature"),o=document.querySelector(".feelsLike"),i=document.querySelector(".condition"),c=document.querySelector(".wind"),a=document.querySelector(".humidity");e.textContent=`${t.location}`,n.textContent=`${t.temperature}°`,o.textContent=`Feels like: ${t.feelsLike}°`,i.textContent=`${t.condition}`,c.textContent=`Wind: ${t.wind} MPH`,a.textContent=`Humidity ${t.humidity}%`}({condition:(e=t).weather[0].main,temperature:Math.round(e.main.temp),feelsLike:Math.round(e.main.feels_like),location:e.name,wind:Math.round(e.wind.speed),humidity:e.main.humidity});var e}))}catch(t){console.log(t)}}()})();